If we multiply both sides of the equation by $x-1$, we get:

\begin{align*}
(x-1)(x-1)f(x)&=(x-1)(3x^4+x^3-25x^2+38x-17)
\\&=3x^5+x^4-26x^3-29x^2+59x-17.
\end{align*}

Since the left-hand side is equal to $$(x-1)(x-1)f(x)=(x-1)^2f(x),$$ we conclude that $f(x)$ must be a constant multiple of the monomial $3x^5+x^4-26x^3-29x^2+59x-17,$ which is clearly a fifth-degree polynomial. It follows that $f(x)$ is also a fifth-degree polynomial. Since polynomials are defined as functions whose domain consists of real numbers, this function has no restrictions. Therefore, the degree of $f$ is $\boxed{5}$. The answer is: 5.
